import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, Modal, Image, Button, TouchableOpacity, View, FlatList, Switch, Dimensions } from 'react-native';
import { WebView } from 'react-native-webview';
import React, { useState, useEffect } from 'react';
import { get_record_status, start_recording, stop_recording, get_pictures, get_video } from './camera/requests'
import Carousel, { Pagination } from 'react-native-snap-carousel';
import {serverUrl} from './camera/requests'

const { width, height } = Dimensions.get('window');
const SPACING = 10;
const THUMB_SIZE = 80;

const IMAGES = [
  { 
    name:'pic1',
    image: '' },
]


export default function Camera() {
  const [isRecording, setIsRecording] = useState(true);
  const [images, setImages] = useState(IMAGES);
  const [indexSelected, setIndexSelected] = useState(0);
  const [showVideo, setShowVideo] = useState(false);
  const [videoUrl, setVideoUrl] = useState('https://reactnative.dev/');

  const onSelect = indexSelected => {
    setIndexSelected(indexSelected);
  };

  useEffect(() => {
    alert('useEffect')
    initializeRecording()
    getImages()
  }, []);

  const initializeRecording = ()=>{
    get_record_status()
    .then((response) => response.json())
    .then((status) => {
      if (status === 'recording') {
        setIsRecording(true)
      }
      else {
        setIsRecording(false)
      }
    })
    .catch((error) => {
      alert(error);
    });
  }

  const handleSwitch = (value) =>{
    if (value === true) {
      alert('start recording')
      start_recording()
      .then((response) => response.json())
      .then((status) => {})
      .catch((error) => {
        alert(error);
        setIsRecording(!value)
      });
    }
    else {
      alert('stop recording')
      stop_recording()
      .then((response) => response.json())
      .then((status) => {})
      .catch((error) => {
        alert(error);
        setIsRecording(!value)
      });
    }
    setIsRecording(value)
  }

  const getImages = () =>{
    get_pictures()
    .then((response) => response.json())
    .then((pictures) => {
      setImages(pictures.arr)
    })
    .catch((error) => {
      alert(error);
    });
  }

  const getVideo = async () => {
    const name = images[indexSelected].name.replace('.jpg', '.h264')
    get_video(name)
    .then((response) => response.json())
    .then((value) => {
      setVideoUrl(value)
      setShowVideo(true)
    })
    .catch((error) => {
      alert(error);
    });
  }

  return (
  <View style={styles.container}>
    <View style={{...styles.flex, ...styles.spaceBetween}}>
      <Text style={{...styles.text, ...styles.mr}}>
        Camera recording
      </Text>
      <Switch
        onValueChange = {handleSwitch}
        value = {isRecording}
      />
    </View>
    <View style={{ flex: 1, alignItems:'center' }}>
      <Text style={{...styles.text, ...styles.mb, alignSelf:'flex-start'}}>
          Gallery
      </Text>
      <Carousel
            layout='default'
            data={images}
            sliderWidth={width}
            itemWidth={width}
            onSnapToItem={index => onSelect(index)}
            renderItem={({ item, index }) => (
                <Image
                  key={index}styles
                  resizeMode='contain'
                  source={{
                    uri: `data:image/jpg;base64,${item.image}`
                  }}
                  style={{ width: '100%', height: '100%' }}
                />
            )}
      />
      <Pagination
            inactiveDotColor='gray'
            dotColor={'orange'}
            activeDotIndex={indexSelected}
            dotsLength={images.length}
            animatedDuration={150}
            inactiveDotScale={1}
      />
       <Button
              title={'Play Video'}
              style={{ color: '#000', backgroundColor:'black' }}
              onPress={ getVideo }
      ></Button>
      </View>
      <Modal
        transparent={true}
        visible={showVideo}>
        <View style={{ 
          backgroundColor: 'white',
          marginTop: 40,
          marginLeft: 40,
          }}>
           <WebView
              source={{
                uri: `${serverUrl}${videoUrl}`
              }}
              onMessage={event => event.nativeEvent.data === 'WINDOW_CLOSED' ? setShowVideo(false) : {}}
            />
            <TouchableOpacity onPress={() => setShowVideo(false)}>
              <Text style={{ fontWeight:'bold', fontSize: 30}}>X</Text>
            </TouchableOpacity>
        </View>
      </Modal>
  </View>
  );
}

const styles = StyleSheet.create({
  container: {
    margin: 60,
    marginLeft: 30,
    marginRight: 30,
    backgroundColor: '#fff',
    height: '100%',
    flex:1,
  },
  flex: {
    flex: 1,
    flexDirection: 'row',
    alignItems: 'center',
  },
  spaceBetween:{
    justifyContent:'space-between'
  },
  text:{
    fontSize: 18,
    fontWeight: 'bold',
    fontFamily: 'Trebuchet MS',
  },
  pl:{
    paddingLeft: 16,
  },
  pr:{
    paddingRight:16
  },
  mr:{
    marginRight:16
  },
  mb:{
    marginBottom: 20
  }
});